xmls = [xmltext, xmltext2, xmltext3, xmltext4, xmltext5, xmltext6, xmltext7, xmltext8, xmltext9, xmltext10, xmltext11, xmltext12, xmltext13, xmltext14, xmltext15, xmltext16]


def xmls_para_excel_cargos(xmls: list, caminho_excel: str):
    import xml.etree.ElementTree as ET
    from openpyxl import Workbook

    wb = Workbook()
    ws = wb.active
    ws.title = "Cargos"

    ws.append(["CODCAR", "ESTCAR", "TITRED", "TITCAR"])

    vistos = set()

    for xml_text in xmls:
        if not xml_text:
            continue

        # ===== LIMPEZA DO XML =====
        xml_text = xml_text.lstrip("\ufeff").strip()
        pos = xml_text.find("<")
        if pos > 0:
            xml_text = xml_text[pos:]

        if not xml_text.startswith("<"):
            continue

        # ===== PARSE SEGURO =====
        try:
            root = ET.fromstring(xml_text)
        except ET.ParseError:
            continue

        for row in root.findall(".//row"):
            cod = row.findtext("CODCAR")

            if not cod or cod in vistos:
                continue

            vistos.add(cod)

            ws.append([
                cod,
                row.findtext("ESTCAR"),
                row.findtext("TITRED"),
                row.findtext("TITCAR")
            ])

    wb.save(caminho_excel)
xmls_para_excel_cargos(xmls, "Cargos.xlsx")